(3952, 1, 'admin/products/1', 'PUT', '223.123.2.118', '{\"showProduct\":\"1\",\"showProduct_cb\":\"on\",\"category\":\"airpod\",\"search_terms\":null,\"title\":\"Homeo Cure Beauty Cream (Pack Of 2) with GLUPATONE Extreme Strong Emulsion 50ml\",\"shortDesc\":\"<p><strong>Earpodes + Watch Gift<\\/strong><\\/p>\\r\\n\\r\\n<ul style=\\\"list-style-type:square;\\\">\\r\\n\\t<li>Cash on delivery&nbsp;<\\/li>\\r\\n\\t<li>0.Rs Delivery Charges<\\/li>\\r\\n\\t<li>Get moderen watch FREE on every order<\\/li>\\r\\n\\t<li>Get free silicon pouch with hanger<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>\\u0642\\u06cc\\u0645\\u062a \\u0627\\u062f\\u0627 \\u06a9\\u0631\\u0646\\u06d2 \\u0633\\u06d2 \\u067e\\u06c1\\u0644\\u06d2 \\u0622\\u067e \\u067e\\u0627\\u0631\\u0633\\u0644 \\u06a9\\u06be\\u0648\\u0644 \\u06a9\\u0631 \\u067e\\u0631\\u0648\\u0688\\u06a9\\u0679 \\u0686\\u06cc\\u06a9 \\u06a9\\u0631\\u0633\\u06a9\\u062a\\u06d2 \\u06c1\\u06cc\\u06ba<\\/p>\\r\\n\\r\\n<div style=\\\"background:#eeeeee;border:1px solid #cccccc;padding:5px 10px;\\\">&nbsp; &nbsp; &nbsp; &nbsp; Rs. <strike>1650<\\/strike><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1260\\/. Rs only&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<\\/strong><\\/div>\",\"description\":\"<h2 dir=\\\"ltr\\\">Description:<\\/h2>\\r\\n\\r\\n<p dir=\\\"ltr\\\">The GLUPATONE Extreme Whitening Emulsion for enhancement of skin lighting focusing on removal of any darkened areas while Homeo Cure Beauty Cream for replenishment of skin. All together it is the full facial and body care that help to moisturize the skin, make it shiny and smooth.<\\/p>\\r\\n\\r\\n<h2 dir=\\\"ltr\\\">How to Use:<\\/h2>\\r\\n\\r\\n<ol>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\">Take a bowl and mix both&nbsp;GLUPATONE cream&nbsp;and&nbsp;Homeo Cure cream&nbsp;together.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\">Apply the mixed cream evenly to your face and body.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\">Use both in the morning and night for best results.<\\/p>\\r\\n\\t<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<h2 dir=\\\"ltr\\\">Key Features:<\\/h2>\\r\\n\\r\\n<p dir=\\\"ltr\\\">GLUPATONE Cream:&nbsp;For a visibly brighter complexion, Targets pigmentation, dark spots and uneven skin tone.<\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\">Homeo Cure Cream:&nbsp;Featuring moisture restoring, nourishing, rejuvenating characteristics, it creates a soft, smooth feel.<\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\">Dual Action:&nbsp;It combines the moisturizing benefits of Homeo cure cream with the brightening power of GLUPATONE cream to give complete skincare.<\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\">Hydrating &amp; Nourishing:&nbsp;Each cream rejuvenates and helps your skin to regain moisture and balance.<\\/p>\\r\\n\\r\\n<p dir=\\\"ltr\\\">Suitable for Face &amp; Body:&nbsp;Ideal for use as all over care on the face and body.<\\/p>\\r\\n\\r\\n<h2 dir=\\\"ltr\\\">What&rsquo;s Included in the Box:<\\/h2>\\r\\n\\r\\n<ul>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\">1 Pack of&nbsp;GLUPATONE Extreme Strong Whitening Emulsion Ultra Plus GS-120&nbsp;(50ml)<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li aria-level=\\\"1\\\" dir=\\\"ltr\\\">\\r\\n\\t<p dir=\\\"ltr\\\" role=\\\"presentation\\\">2 Packs of&nbsp;Homeo Cure Beauty Cream&nbsp;(50g)<\\/p>\\r\\n\\t<\\/li>\\r\\n<\\/ul>\",\"price\":\"1260\",\"designPriceForDetail\":\"<div class=\\\"scaleAnimation shimmerVibrate\\\" style=\\\"width: 7rem; height: 7rem; background-image: url(\'http:\\/\\/127.0.0.1:8000\\/assets\\/bgsale.png\'); background-size: cover; background-position: center; border-radius: 10rem; overflow: hidden; position: absolute; top:0;right:0; display: flex; flex-direction: column; justify-content: center;\\\">\\r\\n<h3 style=\\\"padding: 5px; text-align: center;\\\"><span style=\\\"color: white; opacity:0.8; text-decoration: line-through; font-size: 0.9rem;\\\">2499 Rs<\\/span><br \\/>\\r\\n<span style=\\\"font-size: 1.3rem; font-weight: bold; margin-top: 0.5rem;color:white;\\\">1499 Rs<\\/span><\\/h3>\\r\\n<\\/div>\",\"designPriceForGridItems\":\"<center>\\r\\n<div class=\\\"scaleAnimation shimmerVibrate\\\"><s>2499<\\/s>&nbsp;1399<strong>&nbsp;Rs<\\/strong><\\/div>\\r\\n<\\/center>\",\"showSale\":\"off\",\"sale\":\"<div style=\\\"position: absolute; z-index: 0; top:5px; left: 7px; box-shadow: 2px 2px 2px white; border-radius: 7px;\\\">\\r\\n<div style=\\\"background-color: black; border-radius: 7px;\\\"><b style=\\\"color: white; padding: 3px;\\\">&nbsp; 44% oFF&nbsp;&nbsp;<\\/b><\\/div>\\r\\n<\\/div>\",\"showStock\":\"0\",\"stock\":\"<p style=\\\"color:grey;\\\">Limited Stock <strong style=\\\"color:black;\\\">&nbsp;<\\/strong><\\/p>\\r\\n\\r\\n<p style=\\\"color:grey;\\\"><strong style=\\\"color:black;\\\">145 <\\/strong><s>Sold out<\\/s> in Last <em>Week<\\/em><\\/p>\",\"showVariations\":null,\"addVartiaons\":\"abc\",\"isSoldOut\":\"0\",\"isfreeAnyItemWithThis\":\"0\",\"freeItem\":\"<div style=\\\"height: 5rem; width: 100%; border-radius:3%; display: flex;flex-direction: row;  align-items: center;\\\"><br \\/>\\r\\n<img alt=\\\"\\\" src=\\\"https:\\/\\/ebaba.sale\\/uploads\\/images\\/Untitled%20design%20(1)_1.png\\\" style=\\\"width: 77px; height: 64px;\\\" \\/><img alt=\\\"\\\" src=\\\"watch.png\\\" style=\\\"height: 4rem; background-color: grey;\\\" \\/>\\r\\n<p style=\\\"color: green; padding-right: 1rem;margin-top:3%;\\\">&nbsp;<img alt=\\\"\\\" src=\\\"https:\\/\\/ebaba.sale\\/uploads\\/images\\/Untitled%20design%20-%20Copy.png\\\" style=\\\"width: 75px;\\\" \\/>&nbsp;<\\/p>\\r\\n\\r\\n<p style=\\\"color: green; padding-right: 1rem;margin-top:3%;\\\">&nbsp;<strong>get watch FREE<\\/strong><\\/p>\\r\\n<\\/div>\",\"showtDaysLeft\":\"1\",\"showtDaysLeft_cb\":\"on\",\"daysLeft\":\"8\",\"showSizeVariations\":\"0\",\"sh