iased\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\">.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-top:24px\"><span style=\"font-size:15px\"><span style=\"box-sizing:border-box !important\"><span style=\"-webkit-font-smoothing:antialiased\"><span style=\"color:#282828\"><span style=\"font-family:Zurich, sans-serif\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-weight:400\"><span style=\"white-space:normal\"><span style=\"background-color:#ffffff\"><span style=\"text-decoration-thickness:initial\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\"><span style=\"box-sizing:border-box !important\"><span style=\"-webkit-font-smoothing:antialiased\"><span style=\"box-sizing:border-box !important\"><span style=\"-webkit-font-smoothing:antialiased\"><span style=\"line-height:normal\"><span style=\"font-size:12pt\"><span style=\"box-sizing:border-box !important\"><span style=\"-webkit-font-smoothing:antialiased\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\">Thank you for choosing Ebaba&nbsp;!</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n</div>\r\n</div>', '<h1>Shipping policy</h1>\r\n\r\n<p><strong>E baba Shipping Policy</strong></p>\r\n\r\n<p><strong>1. Shipping Overview</strong></p>\r\n\r\n<p>At Ebaba, we aim to deliver your tech products swiftly and efficiently. Our shipping policy outlines the processes, and delivery times to ensure a smooth shopping experience.</p>\r\n\r\n<p><strong>2. Shipping Time</strong></p>\r\n\r\n<p>We aim to deliver all orders within Pakistan within 3-7 business days. Please note that delivery times may vary based on your location and other factors.</p>\r\n\r\n<p><strong>3. Processing Time</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Order Processing:</strong>&nbsp;Orders are typically processed within 1-2 business days from the time of purchase.</li>\r\n	<li><strong>Order Fulfillment:</strong>&nbsp;Once processed, orders will be shipped.</li>\r\n</ul>\r\n\r\n<p><strong>4. Delivery Times &amp; Rates</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Standard Shipping:&nbsp;</strong>Typically delivered within 5-7 business days after shipping.</li>\r\n	<li>\r\n	<p><strong>Delivery Rates:</strong>Delivery rates are calculated at the time of checkout. The total cost of delivery will be displayed before you confirm your purchase.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>5. Shipping Address</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Address Accuracy:&nbsp;</strong>Please ensure your shipping address is correct before placing your order. We are not responsible for delays or misdeliveries due to incorrect address information.</li>\r\n</ul>\r\n\r\n<p><strong>6. Order Tracking</strong></p>\r\n\r\n<ul>\r\n	<li>Once your order has been shipped, you will receive a confirmation email with a tracking number.You can use this number to track your order in real-time and receive updates on its delivery status.</li>\r\n</ul>\r\n\r\n<p><strong>7. Shipping Issues</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Delayed Shipments:</strong>&nbsp;If you experience delays beyond the estimated delivery times, please contact us for assistance.</li>\r\n</ul>\r\n\r\n<p><strong>8. Contact Us</strong></p>\r\n\r\n<p>For any questions regarding shipping, please reach out to us.</p>\r\n\r\n<p><strong>Last Updated:</strong>&nbsp;[01/09/2024]</p>\r\n\r\n<p>Thank you for shopping with Ebaba.</p>', '<h1>Refund policy</h1>\r\n\r\n<p><strong>Swag Tech Return and Refund Policy</strong></p>\r\n\r\n<p><strong>1. Overview</strong><br />\r\nWe want you to be satisfied with your purchase. If you are not happy with your item, you can return it for a refund.</p>\r\n\r\n<p><strong>2. Return Eligibility</strong></p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Timeframe: Items can be returned within 7 days from the date of receipt.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Condition: Items must be in their original, unused condition with all packaging intact.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Proof of Purchase: A receipt or order number is required for processing returns.</p>\r\n\r\n<p><strong>3. Non-Returnable Items</strong></p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Sale Items: Products purchased on clearance or marked as final sale cannot be returned.</p>\r\n\r\n<p><strong>4. How to Return</strong></p>\r\n\r\n<p>1.&nbsp;<b>Request Return:</b>&nbsp;Email photographic evidence of the item to obtain a return authorization and instructions.<br />\r\n2.&nbsp;<b>Prepare the Item:</b>&nbsp;Ensure the item is securely packed in its original packaging.<br />\r\n3.&nbsp;<b>Ship Back:</b>&nbsp;Send the item to the address provided in the return authorization. Return shipping costs are the responsibility of the customer.</p>\r\n\r\n<p><strong>5. Refunds</strong></p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>Processing Time:</b>&nbsp;Once we receive and inspect the returned item, refunds will be processed to the original payment method within 10 business days.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>Shipping Fees:</b>&nbsp;Original shipping costs are non-refundable.</p>\r\n\r\n<p><strong>6. Damaged or Defective Items</strong></p>\r\n\r\n<p>If your item arrives damaged or defective, contact us immediately with your order details. We will arrange a replacement or refund as needed.</p>\r\n\r\n<p><strong>7. Claim Denial</strong></p>\r\n\r\n<p>Swag Tech reserves the right to deny any return or refund request if the product is damaged, scratched, or missing essential components, including price tags, labels, original packaging, promotional items, and accessories.</p>\r\n\r\n<p><strong>8. Contact Us</strong></p>\r\n\r\n<p>For any questions regarding returns or refunds, please reach out to us at&nbsp;</p>\r\n\r\n<p><strong>Last Updated:</strong>&nbsp;[01/09/2024]</p>\r\n\r\n<p>Thank you for choosing E baba</p>', '<h1>Terms of service</h1>\r\n\r\n<p><strong>Overview</strong></p>\r\n\r\n<p>Welcome to Swag Tech. By accessing our website and using our services, you agree to these Terms of Service. Please read them carefully. If you do not agree, please do not use our site.</p>\r\n\r\n<p><strong>1. Online Store Terms</strong></p>\r\n\r\n<p>You must be of legal age in your jurisdiction to use our site. You agree not to use our products for illegal purposes or transmit harmful code. Any violation may result in immediate termination of services.</p>\r\n\r\n<p><strong>2. General Conditions</strong></p>\r\n\r\n<p>We reserve the right to refuse service to anyone at any time. Content you provide (except for payment information) may be transferred unencrypted. Do not reproduce or exploit any part of our service without written permission.</p>\r\n\r\n<p><strong>3. Accuracy of Information</strong></p>\r\n\r\n<p>We do not guarantee that the information on our site is always accurate or up-to-date. Any reliance on site content is at your own risk. We may update or modify content as necessary.</p>\r\n\r\n<p><strong>4. Modifications and Pricing</strong></p>\r\n\r\n<p>Prices and services are subject to change without notice. We are not liable for any modifications or discontinuations of services.</p>\r\n\r\n<p><strong>5. Products and Services</strong></p>\r\n\r\n<p>Some products may only be available online with limited quantities. We strive for accurate product representation but cannot guarantee display accuracy. For returns or exchanges, refer to our Refund Policy.</p>\r\n\r\n<p><strong>6. Billing and Account Information</strong></p>\r\n\r\n<p>We may limit or cancel orders and require accurate billing and account details. Update your information promptly to ensure transaction completion.</p>\r\n\r\n<p><strong>7. Optional Tools</strong></p>\r\n\r\n<p>We may provide access to third-party tools. Use these tools at your own risk, as we do not control or endorse them.</p>\r\n\r\n<p><strong>8. Third-Party Links</strong></p>\r\n\r\n<p>Our site may include links to third-party websites. We are not responsible for their content or practices. Review third-party policies before engaging.</p>\r\n\r\n<p><strong>9. User Comments</strong></p>\r\n\r\n<p>Comments you submit may be used by us without restriction. Ensure comments do not infringe on rights or contain harmful material.</p>\r\n\r\n<p><strong>10. Personal Information</strong></p>\r\n\r\n<p>Your personal data is managed according to our Privacy Policy, available on our site.</p>\r\n\r\n<p><strong>11. Errors and Omissions</strong></p>\r\n\r\n<p>We are not responsible for errors or inaccuracies on our site. We reserve the right to correct any issues and update information as needed.</p>\r\n\r\n<p><strong>12. Prohibited Uses</strong></p>\r\n\r\n<p>You may not use our site for unlawful purposes, to violate intellectual property rights, or to transmit harmful code. We may terminate your access for violations.</p>\r\n\r\n<p><strong>13. Disclaimer and Limitation of Liability</strong></p>\r\n\r\n<p>Our services are provided &quot;as is.&quot; We do not guarantee uninterrupted or error-free service and are not liable for any damages arising from your use of our site.</p>\r\n\r\n<p><strong>14. Indemnification</strong></p>\r\n\r\n<p>You agree to indemnify Swag Tech for any claims or demands arising from your breach of these Terms or violations of law.</p>\r\n\r\n<p><strong>15. Severability</strong></p>\r\n\r\n<p>If any provision of these Terms is found to be invalid, it will not affect the remaining provisions.</p>\r\n\r\n<p><strong>16. Termination</strong></p>\r\n\r\n<p>We may terminate