(1, 'Homeo Cure Beauty Cream ( Pack of 2 ) With GLUPATONE Emulsion Serum ( Pack of 1 )', 1, 'airpod', '<p><strong>Recomended By Dermatologists</strong></p>\r\n\r\n<ul style=\"list-style-type:square;\">\r\n	<li>apply on face and whole body</li>\r\n	<li>get results in 2 days</li>\r\n	<li>removes dark spots and blemishes</li>\r\n	<li>removes acne and pimples</li>\r\n	<li>whitens underarms and elbows</li>\r\n	<li>whitens hands and feet</li>\r\n</ul>\r\n\r\n<p>            </p>\r\n\r\n<div style=\"background:#eeeeee;border:1px solid #cccccc;padding:5px 10px;\">&nbsp; &nbsp; &nbsp; &nbsp; Rs. <s>246</s><strike>0&nbsp;</strike><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1489/. Rs only&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></div>', '<h2 dir=\"ltr\">&nbsp;</h2>\r\n\r\n<h2 dir=\"ltr\">Why Mix Both ?</h2>\r\n\r\n<p dir=\"ltr\">The GLUPATONE Extreme Whitening Emulsion for enhancement of skin lighting focusing on removal of any darkened areas while Homeo Cure Beauty Cream for replenishment of skin. All together it is the full facial and body care that help to moisturize the skin, make it shiny and smooth.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<h2 dir=\"ltr\">How to Use:</h2>\r\n\r\n<ol>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">Take a bowl and mix full Homeo Cure cream with half GULPATONE Serum</p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">Apply the mixed cream evenly to your face and body.</p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">Use both in the morning and night for best results.</p>\r\n	</li>\r\n</ol>\r\n\r\n<h2 dir=\"ltr\">&nbsp;</h2>\r\n\r\n<h2 dir=\"ltr\">Key Features:</h2>\r\n\r\n<p dir=\"ltr\">GLUPATONE Cream:&nbsp;For a visibly brighter&nbsp; &nbsp; &nbsp; &nbsp;complexion, Targets pigmentation, dark&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;spots and uneven skin tone.</p>\r\n\r\n<p dir=\"ltr\">Homeo Cure Cream:&nbsp;Featuring moisture&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;restoring, nourishing, rejuvenating&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;characteristics, it creates a soft, smooth&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;feel.</p>\r\n\r\n<p dir=\"ltr\">Dual Action:&nbsp;It combines the moisturizing&nbsp; &nbsp; &nbsp; &nbsp;benefits of Homeo cure cream with the&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;brightening power of GLUPATONE cream&nbsp; &nbsp; &nbsp; &nbsp;to give complete skincare.</p>\r\n\r\n<p dir=\"ltr\">Hydrating &amp; Nourishing:&nbsp;Each cream&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;rejuvenates and helps your skin to regain&nbsp; &nbsp; &nbsp; &nbsp;moisture and balance.</p>\r\n\r\n<p dir=\"ltr\">Suitable for Face &amp; Body:&nbsp;Ideal for use as&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;all over care on the face and body.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<h2 dir=\"ltr\">What&rsquo;s Included in the Box:</h2>\r\n\r\n<ul>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">1 Pack of&nbsp;GLUPATONE Extreme Strong Whitening Emulsion Ultra Plus GS-120&nbsp;(50ml)</p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\">2 Packs of&nbsp;Homeo Cure Beauty Cream&nbsp;(50g)</p>\r\n	</li>\r\n</ul>', 'images/2_e3e2de77-2285-42b6-9278-c5c637c9b5d1 (1)_6_1.webp', '[\"images\\/2_e3e2de77-2285-42b6-9278-c5c637c9b5d1 (1)_6.webp\",\"images\\/02_1adc27f8-e003-4fbf-8897-32ae54a0efdf_6.webp\",\"images\\/glupatone.webp\",\"images\\/2_d027c8d6-3e8c-4fa7-abfb-9c82939cd044_6.webp\",\"images\\/71yxGf+TH4L._AC_SY450__7.jpg\",\"images\\/pack-of-two.jpg\",\"images\\/glopthb_8.png\"]', '1489', '<div class=\"scaleAnimation shimmerVibrate\" style=\"width: 7rem; height: 7rem; background-image: url(\'http://127.0.0.1:8000/assets/bgsale.png\'); background-size: cover; background-position: center; border-radius: 10rem; overflow: hidden; position: absolute; top:0;right:0; display: flex; flex-direction: col